const SectionCV = ({ title, content, image }) => {
  return (
    <article>
      <section>
        <h4>{title}</h4>
        <p>{content}</p>
      </section>
      <img src={image} alt="Ariadna Santana" />
    </article>
  );
};
export default SectionCV;
